import React from 'react';
import ReactDOM from 'react-dom';
import '../index.css';
import App from '../App';
import * as serviceWorker from '../serviceWorker';

class About extends React.Component {

	render () {
		return (
			<div>
				<div className="title_component">
					<h1 className="page_title">
					    About Me
					</h1>
				</div>
				<div className="description_component">
					<h2 className="description_title">
					    Who I am
					</h2>
					<p className="description_intro">
						My name is Sam, I'm training to be a Software Developer, I live London, UK
					</p>
					<div className="description_desc">
                        <p className="desciption_desc_p">Always working on software project to build my software engineering skills</p>
                        <p className="desciption_desc_p">and researching new information about software engineering to expand my current knowlegde</p>
					</div>
					<p className="description_project">
						My name is Sam, I'm training to be a Software Developer, I live London, UK
					</p>
				</div>
			</div>
		);
	}
}

export default About;
